            </_notes>
          </annotations>
          <documentation>
            <input/>
            <output/>
            <implementation>
              <description/>
            </implementation>
            <code>
              <description/>
            </code>
          </documentation>
        </call>
        <call id="a2" endpoint="weigh_touch">
          <parameters>
            <label>weigh_touch</label>
            <method>:get</method>
            <arguments/>
          </parameters>
          <code>
            <prepare/>
